import React from 'react';
import { motion } from 'framer-motion';
import { 
  Terminal, 
  Search, 
  FileText, 
  Shield, 
  Zap, 
  Brain, 
  Globe, 
  Settings,
  Database,
  GitBranch,
  Monitor,
  Package
} from 'lucide-react';

const Features = () => {
  const features = [
    {
      icon: <Brain size={32} />,
      title: "Dual AI Modes",
      description: "Switch between online (Together AI) and offline (Ollama) modes for maximum flexibility and privacy.",
      color: "#00d4ff"
    },
    {
      icon: <Terminal size={32} />,
      title: "Safe Command Execution",
      description: "Execute system commands with built-in security checks and dangerous command detection.",
      color: "#0099cc"
    },
    {
      icon: <FileText size={32} />,
      title: "File Operations",
      description: "Read, write, and manage files efficiently with automatic directory creation and validation.",
      color: "#0066ff"
    },
    {
      icon: <Search size={32} />,
      title: "Web Search Integration",
      description: "Integrated web search capabilities via SerpAPI with advanced filtering and result processing.",
      color: "#00d4ff"
    },
    {
      icon: <Database size={32} />,
      title: "Persistent Memory",
      description: "Advanced conversation history and context management that persists across sessions.",
      color: "#0099cc"
    },
    {
      icon: <Monitor size={32} />,
      title: "Professional UI",
      description: "Clean, colorful terminal interface with status indicators, progress bars, and animations.",
      color: "#0066ff"
    },
    {
      icon: <GitBranch size={32} />,
      title: "Modular Architecture",
      description: "Well-structured, maintainable codebase with clear separation of concerns and modern C++17.",
      color: "#00d4ff"
    },
    {
      icon: <Shield size={32} />,
      title: "Security Features",
      description: "Built-in dangerous command detection, input validation, and sandboxed execution environment.",
      color: "#0099cc"
    },
    {
      icon: <Package size={32} />,
      title: "Enterprise Distribution",
      description: "Multi-platform packaging, Docker containers, and package manager integration ready.",
      color: "#0066ff"
    },
    {
      icon: <Settings size={32} />,
      title: "CI/CD Ready",
      description: "Comprehensive GitHub Actions workflows, automated testing, and smart preflight system.",
      color: "#00d4ff"
    },
    {
      icon: <Zap size={32} />,
      title: "Performance Optimized",
      description: "Efficient resource usage, optimized build configuration, and fast response times.",
      color: "#0099cc"
    },
    {
      icon: <Globe size={32} />,
      title: "Cross-Platform",
      description: "Works seamlessly on macOS, Linux, and Windows with consistent behavior across platforms.",
      color: "#0066ff"
    }
  ];

  return (
    <section id="features" className="section">
      <div className="container">
        <motion.div
          initial={{ opacity: 0, y: 50 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
        >
          <h2 className="section-title">Powerful Features</h2>
          <p className="section-subtitle">
            Everything you need for professional AI agent development and deployment
          </p>
        </motion.div>

        <div className="features-grid">
          {features.map((feature, index) => (
            <motion.div
              key={index}
              className="feature-card"
              initial={{ opacity: 0, y: 50 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.6, delay: index * 0.1 }}
              viewport={{ once: true }}
              whileHover={{ y: -5 }}
            >
              <div className="feature-icon" style={{ color: feature.color }}>
                {feature.icon}
              </div>
              <h3 className="feature-title">{feature.title}</h3>
              <p className="feature-description">{feature.description}</p>
            </motion.div>
          ))}
        </div>
      </div>

      <style jsx>{`
        .features-grid {
          display: grid;
          grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
          gap: 30px;
          margin-top: 60px;
        }

        .feature-card {
          background: rgba(255, 255, 255, 0.05);
          border: 1px solid rgba(255, 255, 255, 0.1);
          border-radius: 16px;
          padding: 30px;
          backdrop-filter: blur(10px);
          transition: all 0.3s ease;
          text-align: center;
        }

        .feature-card:hover {
          border-color: rgba(0, 212, 255, 0.3);
          box-shadow: 0 20px 40px rgba(0, 0, 0, 0.3);
        }

        .feature-icon {
          margin-bottom: 20px;
          display: flex;
          justify-content: center;
        }

        .feature-title {
          font-size: 1.3rem;
          font-weight: 600;
          color: white;
          margin-bottom: 15px;
        }

        .feature-description {
          color: #ccc;
          line-height: 1.6;
        }

        @media (max-width: 768px) {
          .features-grid {
            grid-template-columns: 1fr;
            gap: 20px;
          }

          .feature-card {
            padding: 25px;
          }
        }
      `}</style>
    </section>
  );
};

export default Features;
